def solve():
    s = "t8 t2 t1 t12 t26 t27 t4 t23 t27 t6 t26 t19 t1 t26 t4 t23 t6 t8 t14 t24 t20 t28 t24"
    n = len(s)
    if n == 0:
        print("Yes")
        return

    def generate(sub, start, end):
        if start == end:
            return
        for i in range(start, end + 1):
            if i < n:
                yield sub[i]

    if s == generate(s, 0, len(s)):
        print("Yes")
    else:
        print("No")

solve()
